const deleteNode = (root, key) => {
  if (!root) {
    return null;
  }

  if (root.val > key) {
    root.left = deleteNode(root.left, key);
  } else if (root.val < key) {
    root.right = deleteNode(root.right, key);
  } else {
    if (!root.left) {
      return root.right;
    } else if (!root.right) {
      return root.left;
    }

    let cur = root.right;

    while (cur && cur.left) {
      cur = cur.left;
    }

    root.val = cur.val;
    root.right = deleteNode(root.right, root.val);
  }

  return root;
};

